description:
Verenigde Staten
Horror / Thriller
98 minuten

goed

met Rachel Nichols, Simon Reynolds en Wes Bentley

Op kerstavond moet Angela (Rachel Nichols) tot erg laat overwerken. Tot haar grote schrik blijkt dat ze dan die avond het prooi te zijn van een gestoorde beveiligingsagent (Wes Bentley). En aangezien iedereen gezellig thuis kerst zit te vieren, moet Angela helemaal in haar eentje proberen om de daden van de psychopathische agent te overleven. Maar dit is nog niet zo makkelijk.:
